function Carro(t,i,o,r,a,s,h){this.codigo=AppCarro.getCodigoCarro(),this.fabricante=t,this.modelo=i,this.ano=o,this.cor=r,this.valorDia=s||150,this.valorKm=h||2.5,this.placa=function(t){return t.toUpperCase()}(a),this.toString=function(){return this.codigo+" "+this.fabricante+" "+this.modelo+" "+this.ano+" "+this.cor+" ("+this.placa+")"}}
